import React from 'react';
import './styles/HomePage.css';

import logo from './images/8709583.png';

import ChangingText from './ChangingText.js';

const occus = [
  {id: 1, title: 'A Wordpress Developer'},
  {id: 2, title: 'A Full Stack Merceneries'},
  {id: 3, title: 'A Music Producer'},
  {id: 4, title: 'A Software Engineer'},
  {id: 5, title: 'A Marketing Engineer'},
  {id: 6, title: 'A So-so Gamer'},
  {id: 7, title: 'An Introverted Friend'},
  {id: 8, title: 'A Story Lover'}
];

function HomePage() {
  return (
    <div className="HomePage">
      <div className="Content">
	<div className="Home-intro">
	  <div className="Home-image">
	    <img src={logo}/>
	  </div>
	  <div className="Home-info">
	    <div className="Info-name">Hi! I'm <span>Refa Andhika</span></div>
	    <div className="Info-occu"><ChangingText occus={occus}/></div>
	  </div>
	</div>
      </div>
    </div>
  );
}

export default HomePage;
